import React, { Component } from 'react';
import { useState, useEffect } from "react";

class Home extends Component {
   constructor(props) {
    super(props);

    this.state = {
        items: [],
        DataisLoaded: false
    };
   }
   componentDidMount() {
    fetch(
"https://jsonplaceholder.typicode.com/users")
        .then((res) => res.json())
        .then((json) => {
            this.setState({
                items: json,
                DataisLoaded: true
            });
        })
}
    render() {
        return (
            <div>

            </div>
        )
    }
}

export default Home;


